description:
Operation Grand Canyon

Travel Documentary hosted by Dougray Scott, published by BBC in 2014 - English narration


Information
------------------------------

Operation Grand Canyon with Dan Snow
Dan Snow is taking on a massive historical challenge, the first ever exploration of the mighty Colorado River through the Grand Canyon.


1)  Part 1 
Dan Snow and team take on the rapids of the Grand Canyon in antique wooden boats to rediscover one of the Wild West's great adventures of discovery.

2)  Part 2 
Dan Snow and his team continue down the Grand Canyon in antique wooden boats as they rediscover one of the Wild West's great adventures.

